import React from 'react';
import './styles/testimonials.css';

const Testimonials = () => {
  return (
    <section className="testimonials" id="testimonials">
      <h2>User Stories</h2>
      <div className="testimonials-container">
        {/* User Story 1 */}
        <div className="testimonial-card">
          <img src="path/to/user1.jpg" alt="User 1" />
          <h3>User 1</h3>
          <p>
            "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer bibendum consectetur justo nec scelerisque. Proin bibendum, dolor non euismod consectetur, nunc turpis sodales nunc, ac laoreet nulla turpis et mauris."
          </p>
        </div>

        {/* User Story 2 */}
        <div className="testimonial-card">
          <img src="path/to/user2.jpg" alt="User 2" />
          <h3>User 2</h3>
          <p>
            "Nulla facilisi. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc vehicula nibh in sapien eleifend, ut tristique urna venenatis."
          </p>
        </div>

        {/* User Story 3 */}
        <div className="testimonial-card">
          <img src="path/to/user3.jpg" alt="User 3" />
          <h3>User 3</h3>
          <p>
            "Etiam aliquam turpis id quam porttitor, in auctor est egestas. Integer et arcu a nulla gravida suscipit. Cras id scelerisque odio, eget sodales velit."
          </p>
        </div>
      </div>

      {/* Other Stories */}
      <div className="other-stories">
        {/* Other Stories images in circle shape */}
        <img src="path/to/user4.jpg" alt="User 4" />
        <img src="path/to/user5.jpg" alt="User 5" />
        <img src="path/to/user6.jpg" alt="User 6" />
      </div>
    </section>
  );
}

export default Testimonials;
